import React from 'react'
//Page components
import AboutSection from '../components/AboutSection'
import ServicesSection from '../components/SevicesSection'

const AboutUs = () => {
    return(
    <>
        <AboutSection />
        <ServicesSection />
    </>
    )
}

export default AboutUs;
